import React, { useEffect } from 'react';

import NavSearch from '../navSection/NavSearch';
import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const product = {
  name: 'jolof rice',
  desc: 'nigeria jolof',
  price: 1200,
  _id: 'kzd',
  kitchenName: 'iyah-dolof kitchen',
  kitchenRating: 3.5,
  verified: true,
  physicalAddress: '30 udeji street lagos island',
  status: 'available',
  content: ['2 portions of rice', '1 chicken lap'],
  img: 'https://cdn.filestackcontent.com/5ngAPL80SuCvpsEb7S2f',
  imgs: [
    'https://eatwellabi.com/wp-content/uploads/2022/11/Jollof-rice-16.jpg',
    'https://massystoressvg.com/wp-content/uploads/2014/09/TRINI-STYLE-FRIED-CHICKEN-1024x767.jpg',
  ],
};

function Product() {
  const params = useParams();
  const { id } = params;

  useEffect(() => {
    const productHandler = async () => {
      try {
        const { data } = await axios.get();
      } catch (error) {
        console.log(error);
      }
    };
  }, []);
  return (
    <div>
      <NavSearch />
      <Row>
        <Col md={8} className="product">
         <Row>
          <Col md={10}>
          <img src={product.img} alt="" className='border border-danger' style={{width:"100%"}} />
          <div>
            {product.imgs.map((item, index) => (
              <img src={item} alt="" key={index} />
            ))}
          </div>
          </Col>
          <Col col={2}>
          </Col>
         </Row>
        </Col>
        <Col></Col>
      </Row>
    </div>
  );
}

export default Product;
